My protein goals are the highest they have ever been thanks to @frank__carroll. I try to reach my goal mainly using lean meats but come up short sometimes. That's where protein powder comes into play. 
-
Protein powder is a great tool to help anyone achieve there nutrition goals. But, it is not required. Getting your protein from whole foods such as milk and meat will always be better than something processed like protein powder. 
-
I used protein powder almost on the daily and I mix it with nonfat milk as a preworkout. It helps me reach my protoein goals, gets me the nutrtion I need before a workout, and help me not be full or uncomfortable during a workout. 
-
